import React from "react";
import {Container, Row, Col} from 'react-bootstrap';
import './CSS/Footer.css';
import { faFacebook, faTwitter, faInstagram, faLinkedin } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { NavLink } from 'react-router-dom';

function Footer() {
    return (
        <>

        <Container className="c footer" fluid>
    <Row className="c">
    <Col className="c" sm={4}>
    <img src="https://cdn.logo.com/hotlink-ok/logo-social-sq.png" width="200" height="200" alt="logo"/>

    </Col>

    <Col className="c info_col" sm={8}>
        <Row className="c r1">
    <Col className="c footer_options" sm={2}><NavLink to="/">Home</NavLink></Col>
    <Col className="c footer_options" sm={2}><NavLink to="/">Search</NavLink></Col>
    <Col className="c footer_options" sm={2}><NavLink to="/ourstories">Stories</NavLink></Col>
    <Col className="c footer_options" sm={2}><NavLink to="/contactform">Contact Us</NavLink></Col>
        </Row>
        <Row className="c icons">
        <div className="icon_spacing"><FontAwesomeIcon icon={faFacebook} size="2x" style={{ color: '#4267B2' }} /></div>
        <div className="icon_spacing"><FontAwesomeIcon icon={faTwitter} size="2x" style={{ color: '#1DA1F2' }}  /></div>
        <div className="icon_spacing"><FontAwesomeIcon icon={faInstagram} size="2x" style={{ color: '#bc2a8d' }} /></div>
        <div className="icon_spacing"><FontAwesomeIcon icon={faLinkedin} size="2x" style={{ color: '#0e76a8' }} /></div>
        </Row>
    </Col>
  </Row>
        </Container>

        </>
    );
}
export default Footer;
